var SWCGSwitch = msg.payload;
global.set("SWCGSwitch", SWCGSwitch);
var vspSpeed = global.get("vspSpeed");
if (SWCGSwitch == false || SWCGSwitch == true && vspSpeed != "Speed0") {
    return msg;
}

var vspSpeed = global.get("vspSpeed");
if (vspSpeed == "Speed0") {
    var SWCGSwitch = global.get("SWCGSwitch");
    if (SWCGSwitch == true) {
        return [{ payload: false }, { payload: "For SWCG to run, the filter pump must be on !" }];
    }
}

var polarisSwitch = msg.payload;
global.set("polarisSwitch", polarisSwitch);
var vspSpeed = global.get("vspSpeed");
if(polarisSwitch == false || polarisSwitch == true && vspSpeed == "Speed2") {
    return msg;
}

var vspSpeed = global.get("vspSpeed");
if (vspSpeed != "Speed2") {
    var polarisSwitch = global.get("polarisSwitch");
    if (polarisSwitch == true) {
        return [{ payload: false }, { payload: "For Polaris to run, filter pump must run at Speed2 !" }];
    }
}

var current = msg.payload;
if(current >= 1.8) {
    global.set("vspSpeed", "Speed1");
    return [{payload: true}, {payload: false}, {payload: false}];
} else if(current >= 1.2) {
    global.set("vspSpeed", "Speed2");
    return [{ payload: false }, { payload: true }, { payload: false }];
} else if(current >= 0.5) {
    global.set("vspSpeed", "Speed3");
    return [{ payload: false }, { payload: false }, { payload: true }];
} else {
    global.set("vspSpeed", "Speed0");
    return [{ payload: false }, { payload: false }, { payload: false }];
}

